    false,nt"url": null,nt"notes": "This asset includes the Office of Land
    and Emergency Management (OLEM)n Calendar Information, which comprises three OLEM
    Calendars: the OLEM Calendar, the OLEM Meetings and Conference Calls Calendar and
    the OLEM Training and Development Calendar.  nn--The OLEM Calendar is used as a
    means of sharing information about OLEM activities, due dates, meetings, conferences,
    audit followups, and other relevant internal information. Specific OLEM personnel
    have access to add and edit information.  n--The OLEM Meetings and Conference Calls
    Calendar contains national meetings and conference calls with Regions and other
    relevant personnel. n--The OLEM Training and Development Calendar tracks OLEM training
    opportunities.",nt"license_title": null,nt"extras": [{ntt"key": "bbox-east-long",ntt"value":
